const ListItem = (props) => {
    return(
        <li>
                    
            <h2 className='status'>status</h2>
            <h2 className='task'>task: {props.i.text}</h2>
            <button className='chooseBtn'>choose</button>
    
        </li>
    )
}

export default ListItem
